using System;
using System.IO;
using System.Collections;
using System.Collections.Generic;
using UnityEngine;
using UnityEngine.Rendering;
using UnityEngine.UI;

public class GameDB : MonoBehaviour
{
    public static string selfUID;
    public static string selfName;

    public static List<SavedLabData> labTemplates = new List<SavedLabData>();
    public static List<SavedLabData> savedLabDatas = new List<SavedLabData>();
    
    static string saveLabDataDir = "SavedLabs";

    private void Awake()
    {
        selfUID = "player_" + GameUtility.GetMillisecondsFromUTC();
        LoadName();

        LoadTemplates();
        LoadSavedLabs();
    }

    void LoadTemplates()
    {
        labTemplates.Add(new SavedLabData
        {
            saveID = "",
            name = "Blank Room",
            bannerData = "",
            modifiedTimeStamp = "---",
            snapshot = "",
        }); ;
    }

    static void LoadSavedLabs()
    {
        string fullPath = Path.Combine(Application.dataPath, saveLabDataDir);
        bool dirExists = Directory.Exists(fullPath);
        if(!dirExists) Directory.CreateDirectory(fullPath);

        savedLabDatas = new List<SavedLabData>();

        foreach (string file in Directory.GetFiles(fullPath))
        {
            if (!file.EndsWith(".json")) continue;
            string data = File.ReadAllText(file);
            //Debug.Log(data);
            savedLabDatas.Add(JsonUtility.FromJson<SavedLabData>(data));
        }
    }

    public static void SaveLabData(SavedLabData labData)
    {
        string data = JsonUtility.ToJson(labData);
        string filename = (labData.saveID=="" ? GameUtility.GetMillisecondsFromUTC().ToString() : labData.saveID) + ".json";
        string fullPath = Path.Combine(Application.dataPath, saveLabDataDir, filename);
        File.WriteAllText(fullPath, data);

        LoadSavedLabs();
    }

    static void LoadName()
    {
        selfName = PlayerPrefs.GetString("name", selfUID.Substring(0, 16));
    }

    public static void ChangeName(string newName)
    {
        PlayerPrefs.SetString("name", newName);
        LoadName();
    }
}